import React from 'react';
import './App.css';
import back_image from './assets/components/background';

function App() {
    return (
      <div className="App">
        <div className="background" style={{ backgroundAttachment: 'scroll' }}>
            <img src={back_image} alt="back" className="background-image" />
            <header className="App-header">
                <div className="header">
                    <h1 className="header-title">水瀬いのり セッション会</h1>
                </div>
            </header>
        </div>
      </div>
    );
  }
export default App;
